import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/NavBar/Navbar";
import Profile from "./components/Profile/Profile";
import Dialogs from "./components/Dialogs/Dialogs";
import {BrowserRouter, Route} from "react-router-dom";
import News from "./components/News/News";
import Music from "./components/Music/Music";
import Settings from "./components/Settings/Settings";

const App = (props) => {

    return (<BrowserRouter>
            <div className='wrapper'>
                <Header/>
                <Navbar friend={props.state.MessagesData.users}/>
                <div class='app-wrapper-content'>
                    <Route exact path='/dialogs'
                           render={() => <Dialogs
                               dialogs={props.state.MessagesData.users}
                               messages={props.state.MessagesData.messages}
                               avatars={props.state.MessagesData.avatars}/>}/>
                    <Route exact path='/Profile'
                           render={() => <Profile posts={props.state.ProfileData.Posts}
                           addpost={props.AddPost}/>}/>
                    <Route exact path='/News' render={() => <News/>}/>
                    <Route exact path='/Music' render={() => <Music/>}/>
                    <Route exact path='/Settings' render={() => <Settings/>}/>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
